const persona = {
    nombre: 'Tony',
    edad: 45,
    clave: 'Iron Man'
};

const { nombre, edad, clave } = persona;
console.log('Nombre -> ', nombre);
console.log('Edad -> ', edad);
console.log('Clave -> ', clave);

const retornaPersona = (persona) => {
    console.log(persona);
}

retornaPersona(persona);
